    render() {
        return (
            <>
            <header>
                <h1>Кошелек</h1>
                <h2>Калькулятор расходов</h2>
            </header>

            <main>
                <div className="container">
                    <Total />
                    <History />
                    <Operation />  
                </div>
            </main>
            </>
        );
    }
}

export default App;
